import { formValues } from "./Login";
import { auth } from "../firebase";


const handleLogin = ()=>{
        auth.createUserWithEmailAndPassword(formValues.username, formValues.password).then(cred =>{
            console.log(cred);
        });
}

export default handleLogin;
